import React, { useState, useEffect } from 'react';
import { Table } from 'react-bootstrap';
import gameData from '../data/gameData.json';

const Schedule = () => {
  const [games, setGames] = useState([]);

  useEffect(() => {
    // Aquí obtienes los juegos del archivo JSON
    setGames(Object.values(gameData.games));
  }, []);

  return (
    <div className="container mt-4">
      <h3>Fall Schedule</h3>
      <p id="saturday-warning">* All games take place on Saturday</p>

      <h4>SEPTEMBER</h4>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th className="first-header">Date</th>
            <th>Teams</th>
            <th>Location</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {games.map((game, index) => {
            // Filtrar los juegos de septiembre
            if (game.date.startsWith("2025-09")) {
              return (
                <tr key={index}>
                  <td className="first-td">{game.date}</td>
                  <td>{game.teams.join(' vs ')}</td>
                  <td>{gameData.locations[game.location]?.fullName || game.location}</td>
                  <td>{game.time}</td>
                </tr>
              );
            }
            return null;
          })}
        </tbody>
      </Table>

      <h4>OCTOBER</h4>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th className="first-header">Date</th>
            <th>Teams</th>
            <th>Location</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {games.map((game, index) => {
            // Filtrar los juegos de octubre
            if (game.date.startsWith("2025-10")) {
              return (
                <tr key={index}>
                  <td className="first-td">{game.date}</td>
                  <td>{game.teams.join(' vs ')}</td>
                  <td>{gameData.locations[game.location]?.fullName || game.location}</td>
                  <td>{game.time}</td>
                </tr>
              );
            }
            return null;
          })}
        </tbody>
      </Table>
    </div>
  );
};

export default Schedule;
